import React, { Component } from "react";

class Header extends Component {
  render(){
    return(
      <center>
        <b>
          <td>Home |</td>
          <td>Product |</td>
          <td>Kontak |</td>
          <td>Tentang Kami</td>
        </b>
      </center>
    );
  }
}
export default Header;
